window.bookSummaryJSON = "<p>Everyone in town knows Edwina. She is the dinosaur who plays with the kids. She is the dinosaur who helps little old ladies cross the street. And best of all, she bakes yummy chocolate-chip cookies. Everyone loves Edwina except for Reginald Von Hoobie-Doobie. Reginald knows dinosaurs are extinct and is ready to prove it. But will anyone listen? And if they do, what will happen to Edwina? </p>"; 
